import React from "react";

import Grid from "@material-ui/core/Grid";

import ClassificadoItem from "../classificado-item/classificado-item";

const ClassificadoPreview = ({ id, ...otherProps }) => {
  return (
    <div className="classificado-preview">
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <Grid container justify="center" spacing={2}>
            <ClassificadoItem key={id} {...otherProps} />
          </Grid>
        </Grid>
      </Grid>
    </div>
  );
};

export default ClassificadoPreview;
